import React from 'react'
import { Formik, Form, Field, ErrorMessage } from 'formik';
import {Input, Button} from '@material-ui/core';

class AirportForm extends React.Component {
  handleSubmit = (data) => {
    console.log('data: ', data)
    this.props.onSubmit(data);
  }

  handleCancel = () => {
    this.props.onCancel();
  }
  render() {
    return (
      <Formik
       initialValues={{ 
        name: '',
        country: '',
        location: '',
        departingFrom: '',
        landingTo: ''}}
       onSubmit={(values, {setSubmitting}) => {
         console.log(values)
        this.handleSubmit(values);
      }}
       >
       {({ isSubmitting }) => (
         <Form>
          {/*<Input placeholder='Name' name='name'/><br/>
          <Input placeholder='Country' name='country'/><br/>
          <Input placeholder='Location' name='location'/><br/>
          <Input placeholder='Departing from' name='departingFrom'/><br/>
          <Input placeholder='Landing to' name='landingTo'/><br/>
          <Button type='submit' color='primary' variant='contained' onClick={onSubmit}>Submit</Button>
          <Button variant='contained' onClick={this.handleCancel}>Cancel</Button>*/}


          <label htmlFor="name">Name</label>
          <Field id="name" name="name" placeholder="Name" />
          <br/>
          <label htmlFor="country">Country</label>
          <Field id="country" name="country" placeholder="Country" />
          <br/>
          <label htmlFor="location">Location</label>
          <Field id="location" name="location" placeholder="Location" />
          <br/>
          <label htmlFor="departingFrom">Departing from</label>
          <Field id="departingFrom" name="departingFrom" placeholder="Departing from" />
          <br/>
          <label htmlFor="landingTo">Landing to</label>
          <Field id="landingTo" name="landingTo" placeholder="Landing to" />
          <br/>
          <button type="submit">Submit</button>
          <button onClick={this.handleCancel}>Cancel</button>
         </Form>
       )}
     </Formik>
    )
  }
}

export default AirportForm;
